-- Roles, memberships, and object privileges (tables, sequences, functions)
-- Roles
WITH roles AS (
  SELECT rolname, rolsuper, rolinherit, rolcreaterole, rolcreatedb, rolcanlogin, rolreplication, rolconnlimit
  FROM pg_roles
),
-- Role memberships
memberships AS (
  SELECT pg_get_userbyid(member) AS member, pg_get_userbyid(roleid) AS role
  FROM pg_auth_members
),
-- Schema privileges
schema_privs AS (
  SELECT n.nspname AS schema, n.nspname AS obj, 'schema' AS objtype,
         (aclexplode(n.nspacl)).grantee::regrole::text AS grantee,
         (aclexplode(n.nspacl)).privilege_type AS privilege
  FROM pg_namespace n
  WHERE n.nspname NOT IN ('pg_catalog','information_schema','pg_toast')
),
-- Table privileges
tbl_privs AS (
  SELECT n.nspname AS schema, c.relname AS obj, 'table' AS objtype,
         (aclexplode(c.relacl)).grantee::regrole::text AS grantee,
         (aclexplode(c.relacl)).privilege_type AS privilege
  FROM pg_class c
  JOIN pg_namespace n ON n.oid = c.relnamespace
  WHERE c.relkind IN ('r','p','v','m','f')
    AND n.nspname NOT IN ('pg_catalog','information_schema')
),
-- Sequence privileges
seq_privs AS (
  SELECT n.nspname AS schema, c.relname AS obj, 'sequence' AS objtype,
         (aclexplode(c.relacl)).grantee::regrole::text AS grantee,
         (aclexplode(c.relacl)).privilege_type AS privilege
  FROM pg_class c
  JOIN pg_namespace n ON n.oid = c.relnamespace
  WHERE c.relkind = 'S'
    AND n.nspname NOT IN ('pg_catalog','information_schema')
),
-- Function privileges
func_privs AS (
  SELECT n.nspname AS schema, p.proname AS obj, 'function' AS objtype,
         (aclexplode(p.proacl)).grantee::regrole::text AS grantee,
         (aclexplode(p.proacl)).privilege_type AS privilege
  FROM pg_proc p
  JOIN pg_namespace n ON n.oid = p.pronamespace
  WHERE p.proacl IS NOT NULL
    AND n.nspname NOT IN ('pg_catalog','information_schema')
),
-- Default privileges
def_privs AS (
  SELECT pg_get_userbyid(defaclrole) AS def_for_role,
         n.nspname AS schema,
         CASE defaclobjtype WHEN 'r' THEN 'table' WHEN 'S' THEN 'sequence' WHEN 'f' THEN 'function' WHEN 'T' THEN 'type' WHEN 'n' THEN 'schema' END AS objtype,
         (aclexplode(defaclacl)).grantee::regrole::text AS grantee,
         (aclexplode(defaclacl)).privilege_type AS privilege
  FROM pg_default_acl d
  LEFT JOIN pg_namespace n ON n.oid = d.defaclnamespace
)
SELECT 'roles' AS section, NULL::text AS schema, rolname AS name, NULL::text AS field, NULL::text AS value
FROM roles
UNION ALL
SELECT 'memberships', NULL, member, 'member_of', role FROM memberships
UNION ALL
SELECT 'privileges', schema, obj, objtype || ':' || grantee, privilege FROM schema_privs
UNION ALL
SELECT 'privileges', schema, obj, objtype || ':' || grantee, privilege FROM tbl_privs
UNION ALL
SELECT 'privileges', schema, obj, objtype || ':' || grantee, privilege FROM seq_privs
UNION ALL
SELECT 'privileges', schema, obj, objtype || ':' || grantee, privilege FROM func_privs
UNION ALL
SELECT 'default_privileges', schema, def_for_role, objtype || ':' || grantee, privilege FROM def_privs
ORDER BY section, schema NULLS FIRST, name;

